import { Route,Switch } from 'react-router-dom';
import Home from "./components/index/Home";
import Weather from "./components/index/Weather";
import "./App.css";


function App() {
  return (
    <>
    <Home/>
    <Switch>
      <Route path="/">
        <Home/>
      </Route >
      <Route path="/weather">
        <Weather/>
      </Route>
    </Switch>
    </>
  );
}

export default App;
